webpackJsonp([73203908524499],{7677:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/231169872/" title="Photo Sharing"><img src="https://static.flickr.com/62/231169872_fe28e93622.jpg" width="500" height="375" alt="IMG 1742" /></a></p>\n<p>Christopher working on his first homework assignment, a flower that is to be colored for the <em>Einschulung</em> tomorrow. He was supposed to color one leaf each day for 10 days, but he must take after Papa... he put everything off until the last minute.</p>\n<p>His original <a href="http://shop.lego.com/product.asp?p=K10006&amp;cn=223&amp;d=21&amp;t=7">Lego Bionicle <em>Schulranzen</em></a> (schoolbag) is in the background, loaded with the required materials. All systems are go!</p>',fields:{title:"Homework",date:"01 Sep 2006",url:"https://papascott.de/2006-09-01-homework/"}}},pathContext:{slug:"/2006-09-01-homework/",prev:{fields:{title:"Elternabend",date:"01 Sep 2006",slug:"/2006-09-01-elternabend/"}},next:{fields:{title:"Einschulung",date:"02 Sep 2006",slug:"/2006-09-02-einschulung/"}}}}}});
